import React, { useState, useEffect } from 'react';
import { BarChart, CartesianGrid, XAxis, YAxis, Tooltip, Bar } from 'recharts';
import { Card, CardHeader, CardTitle, CardDescription, CardContent } from '../components/ui/Card'; // Custom Card Components

const API_BASE_URL = 'http://localhost:5000/api';

const OverallAnalytics = () => {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    setLoading(true);
    setError(null); // Reset error state on new fetch
    fetch(`${API_BASE_URL}/analytics/overview`)
      .then((res) => {
        if (!res.ok) {
          throw new Error('Failed to fetch overall analytics');
        }
        return res.json();
      })
      .then((data) => {
        setAnalytics(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching overall analytics:', err);
        setError('Error fetching analytics data.');
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="p-4 text-center text-gray-500">Loading overall analytics...</div>;
  if (error) return <div className="p-4 text-center text-red-500">{error}</div>;
  if (!analytics) return <div className="p-4 text-center text-gray-500">No analytics available for the overall view.</div>;

  const intentData = Object.entries(analytics.intent_distribution).map(([intent, count]) => ({
    intent,
    count,
  }));

  const propertyData = Object.entries(analytics.property_interest).map(([property, count]) => ({
    property,
    count,
  }));

  return (
    <div className="grid gap-4 md:grid-cols-2 xl:grid-cols-3">
      {/* Overall Intent Distribution */}
      <Card>
        <CardHeader>
          <CardTitle>Overall Intent Distribution</CardTitle>
          <CardDescription>All customer interactions by purpose</CardDescription>
        </CardHeader>
        <CardContent>
          <BarChart width={400} height={300} data={intentData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="intent" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="count" fill="#8884d8" />
          </BarChart>
        </CardContent>
      </Card>

      {/* Overall Property Interest */}
      <Card>
        <CardHeader>
          <CardTitle>Overall Property Interest</CardTitle>
          <CardDescription>Most viewed or inquired properties</CardDescription>
        </CardHeader>
        <CardContent>
          <BarChart width={400} height={300} data={propertyData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="property" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="count" fill="#82ca9d" />
          </BarChart>
        </CardContent>
      </Card>

      {/* Total Interactions */}
      <Card className="md:col-span-2 xl:col-span-3">
        <CardHeader>
          <CardTitle>Total Interactions</CardTitle>
          <CardDescription>Summary of all customer interactions</CardDescription>
        </CardHeader>
        <CardContent>
          <div className="text-4xl font-bold">{analytics.total_interactions}</div>
        </CardContent>
      </Card>
    </div>
  );
};

export default OverallAnalytics;
